                .speedbox {
                    height: 175px;
                    width: 150px;
                    display: flex;
                    display: -webkit-flex;
                    flex-direction: column;
                    -webkit-flex-direction: column;
                    align-items: center;
                    -webkit-align-items: center;
                    position: relative;
                }
                .speedbox__groove {
                    height: 75px;
                    width: 150px;
                    background: transparent;
                    border-top-left-radius: 100px;
                    border-top-right-radius: 100px;
                    border: 20px solid #eee;
                    border-bottom: 0;
                    box-sizing: border-box;
                    position: absolute;
                    left: 0;
                    top: 0;
                }
                .speedbox__score {
                    position: absolute;
                    left: 0;
                    top: 0;
                    transform: rotate(-45deg);
                    -webkit-transform: rotate(0deg);
                    height: 150px;
                    width: 150px;
                    background: transparent;
                    border-radius: 50%;
                    box-sizing: border-box;
                    cursor: pointer;
                    z-index: 1;
                    transition: transform 0.3s ease;
                }
                .speedbox__base {
                  width: 240px;
                  height: 100px;
                  background: white;
                  position: relative;
                  top: 74px;
                  z-index: 20;
                }
                .speedbox__odo {
                  text-align: center;
                  position: absolute;
                  color: #5c6f7b;
                  bottom: 100px;
                  left: 50%;
                  transform: translateX(-50%);
